export default (function(a,b,c,d,e,f){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},sPKM3rvkQj:{data:{id:893,attributes:{imdbId:"tt0055928",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BOTU3NzExMTQ4N15BMl5BanBnXkFtZTcwMjkzNzQzNA@@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"7.2\u002F10"},{Source:"Rotten Tomatoes",Value:"95%"},{Source:"Metacritic",Value:"78\u002F100"}],item_lang:{data:{id:1556,attributes:{title:"Dr. No",plot:"James Bond 007 is Britain's top agent, and is on an exciting mission, to solve the mysterious murder of a fellow agent. The task sends him to Jamaica, where he joins forces with Quarrel and a loyal C.I.A. Agent, Felix Leiter. While dodging tarantulas, \"fire breathing dragons\", and a trio of assassins, known as \"the three blind mice\". Bond meets up with the beautiful Honey Ryder and goes face to face with the evil Dr. No.",slug:"dr-no"}}},books:{data:[{id:800,attributes:{title:"Dr No",description:"M called this case a soft option. Bond can't quite agree. The tropical island is luxurious, the seductive Honey Rider is beautiful and willing. However, they are both part of the empire of Dr No. His obsession is power, and his gifts are pain-shaped.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=O7SC_IW0noAC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2012-01-01",publisher:"Random House",subtitle:"With an Introduction by Sam Bourne Aka Jonathan Freedland"}},{id:801,attributes:{title:"James Bond 007 Bd. 06. Dr. No",description:"Der Schöpfer von James Bond, geboren 1908 in London, wurde mit Beginn des Zweiten Weltkriegs selbst zum Geheimdienstler der britischen Krone. Wenn also auch vieles von dem, was man in der James-Bond-Romanreihe - die 1953 mit Casino Royale begann und bereits vor dem ersten Film \"James Bond jagt Dr. No\" (1962) begeistert rezipiert wurde - liest, eindeutig in den Bereich der Fiktion gehört, kann das doch nicht über den wahren Kern mancher Episoden und Verweise hinwegtäuschen.-",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=A7aUMAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2013-03-01",publisher:a,subtitle:a}},{id:802,attributes:{title:"James Bond: Dr. No",description:"The legend continues! Stand by for more adventures with the world's greatest secret agent, as some of his most thrilling missions are collected for the first time ever! When two M15 agents disappear in Jamaica, Bond is sent to investigate - but a mysterious assailant attempts to dispatch 007 with everything from poisoned nectarines to killer centipedes! And when Bond links the attacks to the island of Crab Key, owned by the mysterious Doctor No, his troubles are just beginning! This new edition also collects Diamonds Are Forever and From Russia, With Love! Not only that, it also features a new introduction by Eunice Gayson (Sylvia Trench) and the final part of a feature examining the post-Fleming novels!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zPpOEAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b,"Peter O'Donnell","Henry Gammidge"],firstBook:d,published:"2005-09-01",publisher:"Titan Books (US, CA)",subtitle:a}},{id:803,attributes:{title:"Doctor No",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=rlpnPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1989-01-01",publisher:a,subtitle:a}},{id:804,attributes:{title:"Dr No (Heroes and Villains)",description:"Dr Julius No is a man with a mysterious past. Nobody knows what secrets are hidden on his Caribbean island, and all those who have attempted to investigate further have disappeared. When two British agents go missing in Jamaica, Bond is sent to investigate. Battling the Doctor's twin obsessions with power and pain, he uncovers the true nature of his opponent's covert operation - but he must undergo a deadly assault course before he can destroy the Doctor's plans once and for all.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ByTGwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2018-04-05",publisher:"Arrow",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309477283}}("","Ian Fleming","movie",null,"series",1))